			border-bottom: 1px solid #eee;
			background-color: #f9fafb;

			.title {
				font-weight: 600;
				font-size: 14px;
				color: #4c596a;
				padding-bottom: 10px;
			}

			.size {
				display: flex;
				justify-content: center;
			}

		}

		.street-frame-container {
			border-bottom: 1px solid #eee;
			background-color: #f9fafb;

			.type-frame-container {
				display: flex;
				flex-wrap: wrap;
				text-align: center;
				padding-bottom: 15px;
				justify-content: space-between;

				.frame-preview {
					padding-right: 10px;
					padding-left: 10px;
					padding-bottom: 15px;

					img {
						border-radius: 50%;
						cursor: pointer;
						display: flex;
						width: 5rem;
						border: 2px solid #2f394b;
						z-index: 2
					}
				}

				button {
					display: flex;
					color: #292b2c;
					width: 100%;
					cursor: pointer;
					justify-content: center;
					font-size: 13px;
					font-weight: bold;
					background: #fff;
					border: 2px solid #dcdfe6;
				}
			}

		}

}

